WITH filtered_dates AS (SELECT d_date_sk FROM date_dim WHERE d_month_seq BETWEEN 1200 AND 1200 + 11), warehouse_substr AS (SELECT w_warehouse_sk, SUBSTRING(w_warehouse_name, 1, 20) AS w_substr FROM warehouse), filtered_web_sales AS (SELECT ws_warehouse_sk, ws_ship_mode_sk, ws_web_site_sk, ws_ship_date_sk, ws_sold_date_sk FROM web_sales JOIN filtered_dates ON ws_ship_date_sk = d_date_sk)
SELECT ws.w_substr, sm.sm_type, web.web_name, SUM(CASE WHEN (fws.ws_ship_date_sk - fws.ws_sold_date_sk <= 30) THEN 1 ELSE 0 END) AS "30 days", SUM(CASE WHEN (fws.ws_ship_date_sk - fws.ws_sold_date_sk > 30) AND (fws.ws_ship_date_sk - fws.ws_sold_date_sk <= 60) THEN 1 ELSE 0 END) AS "31-60 days", SUM(CASE WHEN (fws.ws_ship_date_sk - fws.ws_sold_date_sk > 60) AND (fws.ws_ship_date_sk - fws.ws_sold_date_sk <= 90) THEN 1 ELSE 0 END) AS "61-90 days", SUM(CASE WHEN (fws.ws_ship_date_sk - fws.ws_sold_date_sk > 90) AND (fws.ws_ship_date_sk - fws.ws_sold_date_sk <= 120) THEN 1 ELSE 0 END) AS "91-120 days", SUM(CASE WHEN (fws.ws_ship_date_sk - fws.ws_sold_date_sk > 120) THEN 1 ELSE 0 END) AS ">120 days" FROM filtered_web_sales AS fws JOIN warehouse_substr AS ws ON fws.ws_warehouse_sk = ws.w_warehouse_sk JOIN ship_mode AS sm ON fws.ws_ship_mode_sk = sm.sm_ship_mode_sk JOIN web_site AS web ON fws.ws_web_site_sk = web.web_site_sk GROUP BY ws.w_substr, sm.sm_type, web.web_name ORDER BY 1 NULLS FIRST, 2 NULLS FIRST, 3 NULLS FIRST LIMIT 100